function go(t){$.get("../xml/movielist.csv",(function(r){for(var e=$.csv.toArrays(r),s='<a href="',d="</a>",n="",h=1;h<e.length;h++){var i=e[h][0];if(84!=t||t!=i.substring(0,1).charCodeAt()||"The"!=i.substring(0,3)||i.substring(0,5)=="The "+String.fromCharCode(t)){if(t==i.substring(0,1).charCodeAt()||i.substring(0,3)=="A "+String.fromCharCode(t)||i.substring(0,5)=="The "+String.fromCharCode(t))n=n+"<tr>"+("<td>"+e[h][2]+"</td>"+(i="<td>"+s+e[h][1]+'">'+i+d+"</td>")+("<td>"+e[h][3]+"</td>")+("<td>"+e[h][4]+"</td>"))+"</tr>";if(35==t&&i.substring(0,1).charCodeAt()>=48&&i.substring(0,1).charCodeAt()<=57)n=n+"<tr>"+("<td>"+e[h][2]+"</td>"+(i="<td>"+s+e[h][1]+'">'+i+d+"</td>")+("<td>"+e[h][3]+"</td>")+("<td>"+e[h][4]+"</td>"))+"</tr>"}}document.getElementById("results").innerHTML='<tr><th class="center" width="25%">Drunk Scale (1-7)</th><th class="center" width="50%">Title</th><th class="center" width="10%">Run Time</th><th class="center">Author</th></tr>'+n}))}